export const TextInput = ({id, label, state, onChange}) => {
	return (
		<div>
			<label htmlFor={id}> {`${label}:`} </label>
			<input id={id} type="text" value={state.value} onChange={onChange}/>
			<div className={!state.status ? "erro" : "hidden"}> {state.error} </div>
		</div>
	);
}

export const PassInput = ({id, label, state, onChange}) => { 
	return (
		<div>
			<label htmlFor={id}> {`${label}:`} </label>
			<input id={id} type="password" value={state.value} onChange={onChange}/>
			<div className={!state.status ? "erro" : "hidden"}> {state.error} </div>
		</div>
	);
}

export const Input = ({id, type, label, state, onChange}) => {
	return (
		<div>
			<label htmlFor={id}> {`${label}:`} </label>
			<input id={id} type="password" value={state.value} onChange={onChange}/>
			<div className={!state.status ? "erro" : "hidden"}> {state.error} </div>
		</div>
	);
}
